const blueTheme = {
	colors: {
		background: '#ffffff',
		opposite: '#272727',

		Primary: '#EFFDFE',
		Secondary: '#BAE0E2',
		Tertiary: '#95D1D4',
		Quaternary: '#8EBDBF',
		Quinary: '#738E8F',
	},
};

export default blueTheme;
